import styled from "styled-components";

const Header = () => {
	return (
		<>
			<Head>
				<HomeProfile>Headers</HomeProfile>
				<ProfileAvatar>P</ProfileAvatar>
			</Head>
		</>
	);
};
export default Header;

const Head = styled.div`
	display: inline;
`;
const HomeProfile = styled.h1`
	font-size: 1.5em;
	text-align: start;
	color: palevioletred;
	margin: 0;
	float: left;
`;

const ProfileAvatar = styled.div`
	text-align: end;
	font-size: 1.5em;
`;
